import React from 'react'
import PropTypes from 'prop-types'

const styles = {
    li: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '.5rem 1rem',
        border: '1px solid #ccc',
        borderRadius: '4px',
        marginBottom: '.5rem'
    }
}

function TodoItem({text, index}) {
    // return <li>{tex.text.title}</li>   ete {} chenk krm
    return (
        <li style={styles.li}>
            <span>
                <input type="checkbox"/>
                <strong>{index + 1}</strong>
                {text.title}
            </span>

            <button>&times;</button>
        </li>)
}

TodoItem.propTypes = {
    text: PropTypes.object.isRequired,
    index: PropTypes.number
}

export default TodoItem
